    "2013-03-14T19:26:57.865058",nt"name": "herp-searches-spears-and-didion-ranches-ds323",nt"isopen":
    false,nt"url": null,nt"notes": "These data are detections of reptiles in
    2005 from visual encounter searches of an area constrained to a 100-m radius circle
    around each of 15 fixed sample points at Spears and Didion Ranches, Placer County,
    California. Surveys were done three times in April and May by trained observers
    who searched the entire 100-m radius (3.1 ha) circular plot looking on and under
    rocks, logs, and debris for reptiles and amphibians. Fifty-eight detections were
    made of five species of reptiles and one species of amphibian.",nt"license_title":
